class App extends Component{
    render(){
        var bio = (
            <div>
                <p> I am persuing Btechf rom MIET, Meerut</p>
                <p></p>
            </div>
        )
        return(
            <div>
                <h1>Aditi Gupta</h1>
                <p>My name is Aditi Gupta. I am a jr. associate IT.</p>
            </div>
        )
    }
}
export default App;
